import React , {Component} from 'react'
import {Link} from 'react-router-dom'


class NavFooter extends Component{
    render (){
        return(
            <footer class="footer">
                <div class="container">
                    <span class="text">
                        le footer.
                    </span>
                    <button></button>
                    <button></button>
                    <button></button>
                </div>
            </footer>
        )
    }
}
export default NavFooter;
